  title: `Swift Optionals?`,
  description: `Dealing with the absence of value`,
  date: '2021-03-31T15:45:00.000Z',
  authors: [waynedahlberg],
  discussion: 'https://github.com/tailwindlabs/tailwindcss/discussions/2511'
